import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useRouteMatch
} from "react-router-dom";
import Home from './dachboard/Home';

function Dachboard() {
    let match = useRouteMatch();
    console.log(match.url)
    return (
        <>
            <h1>dachboard</h1>
            <Switch>
                <Route path={`${match.path}/`}>
                    <Home />
                </Route>
            </Switch>
        </>
    )
}

export default Dachboard
